[Character Sheet 2/9, more to come!]

Meet Naka’s mom, Saja (Sah-Hah)! She is a 43 year old alumnus of Shiketsu High, and a registered nurse! When her daughter, Naka, was young and unable to control her quirk, she harmed herself often due to her inability to stop the metal shards from hitting herself. As a result, Saja found her daughter on numerous occasions with new wounds all over her. Knowing that bringing Naka into a hospital or doctor setting could make matters worse, due to the metal intrustments and tools, she tried to take care of Naka’s wounds at home. Through her care and practice she did for Naka, she decided to go back to school when her eldest son turned 13, since she figured he could baby sit the younger siblings, and got her nursing license! Although she knew she could’ve spent her life training to become a hero she decided to focus more on family life, similarly to Naka’s father, Keiji. 

